import React from "react";
import { Router,Routes,Route } from "react-router-dom";
import Nav from "./Nav"
import Movie from "./Movie"
import Booking from "./Booking"
 function App(){
    return(
       <>
       <Nav/>
       <Routes>
        <Route path='/' element={<Movie/>}></Route>
        <Route path='/Booking' element={<Booking/>}></Route>
       </Routes>
       
       </>

    )
 }

 export default App;
